DROP TABLE IF EXISTS Disabilities;
CREATE TABLE Disabilities(
   DisabilitiesID       VARCHAR(7) NOT NULL PRIMARY KEY
  ,ProjectEntryID       INTEGER  NOT NULL
  ,PersonalID           INTEGER  NOT NULL
  ,InformationDate      DATE  NOT NULL
  ,DisabilityType       INTEGER  NOT NULL
  ,DisabilityResponse   INTEGER  NOT NULL
  ,IndefiniteAndImpairs INTEGER 
  ,DocumentationOnFile  BIT 
  ,ReceivingServices    BIT 
  ,PATHHowConfirmed     INTEGER 
  ,PATHSMIInformation   VARCHAR(30)
  ,TCellCountAvailable  VARCHAR(30)
  ,TCellCount           VARCHAR(30)
  ,TCellSource          VARCHAR(30)
  ,ViralLoadAvailable   VARCHAR(30)
  ,ViralLoad            VARCHAR(30)
  ,ViralLoadSource      VARCHAR(30)
  ,DataCollectionStage  INTEGER  NOT NULL
  ,DateCreated          VARCHAR(14) NOT NULL
  ,DateUpdated          VARCHAR(14) NOT NULL
  ,UserID               INTEGER  NOT NULL
  ,DateDeleted          VARCHAR(30)
  ,ExportID             INTEGER  NOT NULL
);
